import styled from 'styled-components';

export const ContainerSpock = styled.div`
  background-color: rgb(255, 255, 255);
  width: 80px;
  height: 80px;
  border: solid 13px rgb(222, 80, 90);
  border-radius: 70px;
  display: flex;
  justify-content: center;
  align-items: center;

  & img {
    width: 45%;
  }
`;
